import React, { useEffect, useState } from 'react';
import Navbar from '../Components/Navbar';
import { useLocation } from 'react-router-dom';
import axios from 'axios';
import { BASE_URL } from '../config';

const SeeResult = () => {
    const location = useLocation();
    const [results, setResults] = useState({ positiveFeedback: '', negativeFeedback: '' });

    useEffect(() => {
        const fetchData = async () => {
            const enrollId = location.state || {};
            const response = await axios.get(`${BASE_URL}/interviewer/result/${enrollId}`);
            setResults(response.data);
        }
        fetchData();
    }, [location.state]);

    return (
        <div>
            <Navbar />
            <div className="grid grid-rows-[auto,1fr] gap-3 p-3 h-screen bg-gray-800">
                <div className="flex flex-col items-center justify-center h-full space-y-6">
                    <div className="w-1/2 p-4 bg-green-500 text-white rounded-lg shadow-lg">
                        <h3 className="text-xl font-bold">Positive Feedback</h3>
                        <p>{results.positiveFeedback}</p>
                    </div>
                    <div className="w-1/2 p-4 bg-red-500 text-white rounded-lg shadow-lg">
                        <h3 className="text-xl font-bold">Negative Feedback</h3>
                        <p>{results.negativeFeedback}</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default SeeResult;
